Emits the contract metadata. The metadata is a JSON object that contains information about the contract, such as its name, source code hash, the list of dependencies, compiler versions, and so on. The solx metadata format is compatible with the Solidity metadata format . This means that the metadata output can be used with other tools that support Solidity metadata. Extra solx data is inserted into solc metadata with this JSON object: { "solx": { "llvm_options": [], "optimizer_settings": { "is_debug_logging_enabled": false, "is_fallback_to_size_enabled": false, "is_verify_each_enabled": false, "level_back_end": "Aggressive", "level_middle_end": "Aggressive", "level_middle_end_size": "Zero" }, "solc_llvm_revision": "1.0.2", "solc_version": "0.8.30", "solx_version": "0.1.0" }
} Usage: solx 'Simple.sol' --metadata Output: ======= Simple.sol:Simple =======
